func (c *current) onarguments1(pat any) (any, error) {

	var args []ast.Expression

	p := pat.([]any)
	args = append(args, p[0].(ast.Expression))
	for _, repeat := range p[1].([]any) {
		pattern := repeat.([]any)
		args = append(args, pattern[1].(ast.Expression))
	}
	return args, nil
}

